import { Container, Grid, Typography} from '@material-ui/core';
import styles from'./Header.module.css';

 export default function Header (){
    return (
        <div className={styles.header} >
            <Container fixed >
               <Grid container >
                   <Grid item xs={12} sm={6} >
                     Conteudo 1
                   </Grid>

               </Grid>
            </Container>
        </div>
    )
}
